import React, { useState } from 'react';
import Button from './Button';
import Counter from './Counter';
import CounterMax from './CounterMax';

function ParentWrapper(){

    const [valeur, setValeur] = useState(0);

    function add(){
        setValeur(valeur + 1);
    }
    function sub(){
        setValeur(valeur - 1);
    }

    return (
        <div className="wrapper_parent">
            {valeur > 3 ? <CounterMax /> : <Counter valeur={valeur} />}
            <div className="wrapper">
                <Button styleclass="red" label="Retirer" onClick={sub}/>

                {valeur > 3 ? <Button styleclass="green deactivate" label="Ajouter"/> : <Button styleclass="green" label="Ajouter" onClick={add}/>}
            </div>
        </div>
    );

}

export default ParentWrapper;
